        [head=1]CC TURRET NOTICE[/head]

         Greetings, valued Sheriff of the Monolith sector. After the reconstruction of the NFSDO, we added several new things, including a perma, camera monitor network, and most importantly: turrets.

         The turrets themselves are AK570 90mm Heavy Autocannons, and where put in place as a self-defense measure. They should [bold]NOT[/bold] be used in any other case, and even then should be scarcely used. If you can board an approaching enemy vessel, it is much prefered that you keep the shuttle intact and sell it back to us in hopes of reverse engineering it.

